double ** init_array(int size){
	int k;
	double ** arr;
	arr = (double**) malloc(size*sizeof(double*));
	for (k = 0; k < size; k++)
		arr[k] = (double*) calloc(size,sizeof(double));
	if(arr == NULL){
		printf("%f",arr[0][0]);
		return (double **)NULL;}
		return arr;
}

